function ImagePopup (){
    return (
        <section class="popup popup_type_image popup_is-opened">
          <div class="popup__image-box">
            <figure class="popup__image-container">
              <img class="popup__image-foto" type="url" src="#" />
              <figcaption class="popup__image-sign" type="text"></figcaption>
            </figure>
            <button class="popup__close" type="button"></button>
          </div>
        </section>
    )
}

export default ImagePopup;
